Leech:=LatticeList[1];
    DataList:=[* *];

    Append(~DataList,24);
    Append(~DataList,0);
    Append(~DataList,1);
    Append(~DataList,Level(Leech));
    Append(~DataList,ShortString(GenusRepresentatives[1]));
    Append(~DataList,"\"" cat ShortString(Density(Leech)) cat "\"");
    Append(~DataList,"\"" cat ShortString(HermiteNumber(Leech)) cat "\"");
    Append(~DataList,Minimum(Leech));
    Append(~DataList,KissingNumber(Leech));

    S:=ShortestVectors(Leech);
    vec_list:=[];
    for s in S do
        vec:=[];
        for i in [1..24] do
            Append(~vec,s[i]);
        end for;
        Append(~vec_list,"\"" cat ShortString(vec) cat "\"");
    end for;

    Append(~DataList,vec_list);

    AutList:=[**];
    Append(~AutList,#AutomorphismGroup(Leech));
    Append(~AutList,#Generators(AutomorphismGroup(Leech)));
    GenList:=[];
    for v in Generators(AutomorphismGroup(Leech)) do
        GenMat:=[];
        for i in [1..24] do
            row:=[];
            for j in [1..24] do
                Append(~row,v[i][j]);
            end for;
            Append(~GenMat,row);
        end for;
        Append(~GenList,"\"" cat ShortString(GenMat) cat "\"");
    end for;
    Append(~AutList,ShortString(GenList));
    Append(~AutList,"\"\"");

    Append(~DataList,AutList);

    Append(~DataList,"\"\"");
    Append(~DataList,24);
    Append(~DataList,ShortString(GenusRepresentatives));
    Append(~DataList,"\"Leech\"");
    Append(~DataList,"\"\"");
    Write("LeechGenus", ShortString(DataList));
